import React from "react";
import PropertyCard from "./PropertyCard"; // Assurez-vous que PropertyCard.tsx est bien importé.

const ViuLaNatura = () => {
  // Exemple de données pour une propriété
  const property = {
    title: "PLANA DE CAL BOU",
    description:
      "Une maison moderne, située dans la vallée, idéale pour les familles cherchant la tranquillité.",
    images: [
      "https://via.placeholder.com/300x200", // Placeholder image
      "https://via.placeholder.com/300x200", // Placeholder image
      "https://via.placeholder.com/300x200", // Placeholder image
    ],
    link: "/lot-de-bien/cal-bou", // Lien vers la page du lot de bien spécifique
  };

  return (
    <div style={{ backgroundColor: "#212226", padding: "40px 0" }}>
      <h1 style={{ textAlign: "center", color: "#FFF", fontSize: "3rem" }}>
        TOT NATURA
      </h1>

      {/* Affichage de la première propriété */}
      <PropertyCard
        title={property.title}
        description={property.description}
        images={property.images}
        link={property.link}
      />
    </div>
  );
};

export default ViuLaNatura;
